import React from 'react';
import classes from './FooterList.module.css';

const Footer = (props) => (
  <>
    <li className={classes.List}>
      <a className={classes.Anchor} href={props.redirect}>
        <span></span>
        <style jsx>
          {`span{
          background-image: url("${props.icon}")
        `}
        </style>
      </a>
    </li>
  </>
);

export default Footer;
